class Result {

    /*
     * Complete the 'getCost' function below.
     *
     * The function accepts WEIGHTED_INTEGER_GRAPH g as parameter.
     */

    /*
     * For the weighted graph, <name>:
     *
     * 1. The number of nodes is <name>Nodes.
     * 2. The number of edges is <name>Edges.
     * 3. An edge exists between <name>From[i] and <name>To[i]. The weight of the edge is <name>Weight[i].
     *
     */

    public static void getCost(int gNodes, List<Integer> gFrom, List<Integer> gTo, List<Integer> gWeight) {

        int[] fareArray = new int[gNodes];
        Arrays.fill(fareArray, 50000);
        fareArray[0] = 0;

        List<Integer> visited = new ArrayList<>();

        int nextNodeToVisit = getSmallestNotVisitedNode(visited, fareArray);
        while(nextNodeToVisit>=0){
            for(int i = 0; i<gFrom.size(); i++){
                if(gFrom.get(i) == nextNodeToVisit+1){
                    int tempCharge;
                    if(fareArray[gFrom.get(i)-1] < gWeight.get(i) ){
                        tempCharge = gWeight.get(i);
                    }else{
                        tempCharge =fareArray[gFrom.get(i)-1];
                    }
                    if(fareArray[gTo.get(i)-1]>tempCharge){
                        fareArray[gTo.get(i)-1] = tempCharge;
                    }
                }
            }
            visited.add(nextNodeToVisit);
            nextNodeToVisit = getSmallestNotVisitedNode(visited, fareArray);
        }
        System.out.println(fareArray[gNodes-1]);

    }

    private static int getSmallestNotVisitedNode(List<Integer> visited, int[]fareArray){
        int result = -1;
        int currentSmallestFare = 50001;
        for(int i=0; i<fareArray.length ; i++ ){
            if(!visited.contains(i) && fareArray[i]<=currentSmallestFare){
                currentSmallestFare = fareArray[i];
                result = i;
            }
        }
        return result;
    }

}

